import './company-add-coupon.css'
import history from './../../../../../../history'

export default function CompanyAddCoupon() {
    return (
        <div className='CompanyAddCoupon'>
            <div className='CompanyAddCoupon-inner-div'>
                <button onClick={() => { history.push('/company/my-coupons') }}>X</button>
            </div>
        </div>
    )
}
